import React from 'react';
import '../../resources/templates.css';

const Template5 = ({ user }) => {
  const { firstName, lastName, Email, address, mobilenum, Education, Experience, projects, skills, objective } = user;

  return (
    <div className='template5-parent'>
      <div className='template-header'>
        <h1>{`${firstName} ${lastName}`}</h1>
        <div>
          <p>{Email}</p>
          <p>{address}</p>
          <p>{mobilenum}</p>
        </div>
      </div>

      <div className='divider'></div>

      <div className='objective'>
        <h3>Objective</h3>
        <p>{objective}</p>
      </div>

      <div className='divider'></div>

      <div className='Education'>
        <h3>Education</h3>
        <hr />
        {Education.map((edu) => (
          <div key={edu.year} className='education-item'>
            <h6>{edu.year}:</h6>
            <p>
              <b>{edu.Qualification}</b> with <b>{edu.Percentage}%</b> in {edu.Institution}
            </p>
          </div>
        ))}
      </div>

      <div className='divider'></div>

      <div className='Experience'>
        <h3>Experience</h3>
        <hr />
        {Experience.map((exp) => (
          <div key={exp.year} className='experience-item'>
            <h6>{exp.year}:</h6>
            <p>
              <b>{exp.Company}</b> in <b>{exp.Place}</b>
            </p>
          </div>
        ))}
      </div>

      {projects.length > 0 && (
        <div className='divider'>
          <div className='projects'>
            <h3>Projects</h3>
            <hr />
            {projects.map((project) => (
              <div key={project.Title} className='project-item'>
                <h6>
                  <b>{project.Title} [{project.year}]</b>
                </h6>
                <p>{project.description}</p>
              </div>
            ))}
          </div>
        </div>
      )}

      <div className='divider'>
        <div className='Skills'>
          <h3>Skills</h3>
          <ul>
            {skills.map((skill) => (
              <li key={skill.technology}>{skill.technology}</li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Template5;
